import React from "react";
import { useEffect } from "react";
import { styled } from "@mui/material/styles";
import Box from "@mui/material/Box";
import Paper from "@mui/material/Paper";
import { useDispatch, useSelector } from "react-redux";
import { getRepository } from "../../redux/repos/actioncCreator";
import "./repos.css";
import { Grid } from "@mui/material";
const Repos = () => {
  const dispatch = useDispatch();

  useEffect(() => {
    FetchRepoData();
  }, []);

  const Item = styled(Paper)(({ theme }) => ({
    backgroundColor: theme.palette.mode === "dark" ? "#1A2027" : "#fff",
    ...theme.typography.body2,
    padding: theme.spacing(1),
    textAlign: "center",
    color: theme.palette.text.secondary,
  }));
  const FetchRepoData = async () => {
    await dispatch(getRepository());
  };

  const RepoData = useSelector((state) => state.RepositoryReducer.repo.items);
  console.log("data", RepoData);
  return (
    <div className="container">
      <p className="Heading">Most Starred Repos</p>

      <div>
        <Grid container spacing={2}>
          {RepoData?.map((data) => {
            return (
              <>
                <Grid item xs={12} sm={12} md={12} className="grid-columns">
                  <Item>1</Item>
                </Grid>
              </>
            );
          })}
        </Grid>
      </div>
    </div>
  );
};

export default Repos;
